import { combineReducers } from 'redux';
import alertReducer from './alert';
import authReducer from './auth';
import productsReducer from './products';
import cartReducer from './cart';


export default combineReducers({
  alertReducer,
  authReducer,
  productsReducer,
  cartReducer
});
